import React from "react";
import Back from "../../img/back.png";
//import Productone from "../../img/logo1.png";
//import Bottleone from "../../img/bottle1.png";
import "./Product.css";
import { Link } from "react-router-dom";
const initialList = [
  {
    id: "a",
    name: "Robin",
    image:
      "<img src='https://images.unsplash.com/photo-1549223123-e05d6e08643d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60' />",
  },
  {
    id: "b",
    name: "Dennis",
    image:
      "<img src='https://images.unsplash.com/photo-1549223123-e05d6e08643d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60' />",
  },
];

const Product = () => {
  const [list, setList] = React.useState(initialList);
  const [name, setName] = React.useState("");

  function handleChange(event) {
    setName(event.target.value);
  }

  function handleAdd() {
    const newList = list.concat({ name });

    setList(newList);
  }

  return (
    <div className="Product">
      <div className="lang-background">
        <Link to="/Lang">
          <div className="btn-back">
            <img src={Back} alt="" />
          </div>
        </Link>
        <div className="product-top-text">Select product</div>

        <div className="bottom-list">
          <ul>
            {initialList}
            {/* {list.map((item) => (
              <li key={item.id}>{item.image}</li>
            ))} */}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Product;
